import React from 'react';

const getImageForHouse = (house) => {
    switch (house) {
        case 'Hufflepuff': return 'data:image/jpeg;base64,'
        case 'Slytherin': return 'data:image/jpeg;base64,'
        case 'Gryffindor': return 'data:image/jpeg;base64,'
        case 'Corvinal': return 'data:image/jpeg;base64,'
        default: return 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT1OYors4uIvrh1RIGWpsjiKP-ubsUjAUQRkzsTftHOwGaECuYr'
    }
}

const Character = ({ name, house = 'Hogwarts', bloodStatus }) => (
    <div className="max-w-sm rounded overflow-hidden shadow-lg m-10">
        <img className="w-full" height="200" width="200" src={getImageForHouse(house)} alt={`Logo of ${house}`} />
        <div className="px-6 py-4">
            <div className="font-bold text-xl mb-2">{name}</div>
            <p className="text-grey-darker text-base">
                {house}
            </p>
        </div>
        <div className="px-6 py-4">
            <span
                className="inline-block bg-grey-lighter rounded-full px-3 py-1 text-sm font-semibold text-grey-darker mr-2">
                {bloodStatus || 'Hogwarts'}
            </span>
        </div>
    </div>
)

class Home extends React.Component {
    render() {
        const { characters } = this.props

        if (!characters.length) return <h1>Loading...</h1>

        return (
            <div className="flex flex-wrap">
                {characters.map((char, index) => <Character {...char} />)}
            </div>
        )
    }
}

export default Home;
